const A="Microbiology Chapter 10 Homework",v="Homework questions for Microbiology Chapter 10.",e="Microbiology",g=[{id:"mc-ch10-hw-1",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 10",topic:"Genetic Engineering",difficulty:"easy",question:"Viruses can reproduce on their own.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. Viruses are obligate intracellular parasites and require a host cell's machinery to replicate."},{id:"mc-ch10-hw-2",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 10",topic:"Genetic Engineering",difficulty:"easy",question:"To what structure is the arrow pointing?",image:"data:image/jpeg;base64,",options:["bacteria","DNA","polysaccharide","protein coat"],correctAnswer:3,explanation:"The arrow is pointing to the protein coat, also known as the capsid, which encloses the genetic material of the virus."},{id:"mc-ch10-hw-3",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 10",topic:"Genetic Engineering",difficulty:"medium",question:"Bacteriophages can each infect a multitude of different species of bacteria.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. Bacteriophages are typically host-specific, meaning a particular bacteriophage can only infect a specific species or even specific strains of bacteria."},{id:"mc-ch10-hw-4",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 10",topic:"Genetic Engineering",difficulty:"easy",question:"This restriction enzyme makes a 'cut' between G and A.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. The image shows the recognition site for a restriction enzyme, and the cut is indicated between the Guanine (G) and Adenine (A) bases."},{id:"mc-ch10-hw-5",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 10",topic:"Genetic Engineering",difficulty:"easy",question:"CAS is a DNA cutting enzyme.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. Cas (CRISPR-associated) proteins, such as Cas9, are enzymes that can be programmed to cut DNA at specific locations."}],I={name:A,description:v,subject:e,questions:g};export{I as default,v as description,A as name,g as questions,e as subject};
